import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";

function Login(){
    return(
        <center>
            <div>
                <form>
                    <div className="mb-3">
                    <label for="formGroupExampleInput" className="form-label">Enter Your Email Id :</label>
                    <input type="email" className="form-control" id="email" placeholder="Enter you Email Id" required/>
                    </div>
                    <div className="mb-3">
                    <label for="formGroupExampleInput2" className="form-label">Enter Your Password :</label>
                    <input type="password" className="form-control" id="password" placeholder="Enter your Password" required/>
                    </div>

                    <div className="col-12">
                        <button type="submit" className="btn btn-primary">Sign in</button>
                    </div>
                </form>
            </div>
        </center>
    )
}

export default Login;
